import { BrowserRouter, Routes, Route } from 'react-router-dom';
import MainLayout from './components/MainLayout/MainLayout';
import Dashboard from './pages/Dashboard/Dashboard';
import UserManagement from './pages/UserMngmt/UserMngmt';

function App() {
  return (
    // The BrowserRouter provides routing ability to the whole app
    <BrowserRouter>
      {/* MainLayout is our persistent shell with the sidebar and topbar */}
      <MainLayout>
        {/* The <Routes> component will swap content based on the URL */}
        <Routes>
          {/* This is the default route (e.g., "localhost:3000/") */}
          <Route path="/" element={<Dashboard />} />

          {/* This is the route for our user page */}
          <Route path="/users" element={<UserManagement />} />

          {/* You can add more routes here later */}
          {/* <Route path="/profile" element={<ProfilePage />} /> */}
        </Routes>
      </MainLayout>
    </BrowserRouter>
  );
}

export default App;
